import React, { useEffect, useRef, useState } from 'react';
import { Card, CardHeader, Container, Row, Col, CardFooter, Button, Modal, Spinner } from "reactstrap";
import { useDispatch, useSelector } from 'react-redux';
import { Link, useHistory } from "react-router-dom";
import { Button as Btn } from 'primereact/button';
import { DataTable } from 'primereact/datatable';
import { Column } from 'primereact/column';
import { Tooltip } from '@chakra-ui/react';
import { InputText } from 'primereact/inputtext';
import { FilterMatchMode, FilterOperator } from 'primereact/api';
import { toast } from 'react-toastify';
import { jsPDF } from 'jspdf';
import axios from 'axios';
import 'react-toastify/dist/ReactToastify.css';
import moment from 'moment';
// Import your Redux actions here
import { FindRequestDemande, DeleteMission, findDemandsstatisticsByPartner, FindRequestDemandeByPartner } from 'Redux/actions/Demandes.Actions';
import { SET_SINGLE_DEMANDE } from 'Redux/types';
import UserHeader from 'components/Headers/UserHeader';
// import { jsPDF } from 'jspdf';
import 'jspdf-autotable';
import { Tag } from 'primereact/tag';
import { Dropdown } from 'primereact/dropdown';
// import { useHistory } from 'react-router-dom';
function ListOfMissions() {
  const history = useHistory();
    const navigate = useHistory();
    const dispatch = useDispatch();

    const requests = useSelector(state => state?.DemandeDriver?.demandes?.demands);
    const isLoad = useSelector(state => state?.isLoading?.isLoading);
    const isSuccess = useSelector(state => state?.success?.success);

    const [globalFilterValue, setGlobalFilterValue] = useState('');
    const [filters, setFilters] = useState({
        global: { value: null, matchMode: FilterMatchMode.CONTAINS },
    });

    const [notificationModal, setnotificationModal] = useState(false);
    const [selectedItem, setselectedItem] = useState(null);
    const [checked, setChecked] = useState(false);
    const [loading, setLoading] = useState(false);

    useEffect(() => {
        dispatch({
            type: SET_SINGLE_DEMANDE,
            payload: {},
        });
        dispatch(FindRequestDemande());
        dispatch(findDemandsstatisticsByPartner());
        dispatch(FindRequestDemandeByPartner());
    }, []);

    useEffect(() => {
        if (isSuccess) {
            showToastMessage();
        }
    }, [isSuccess]);

    const showToastMessage = () => {
        toast.success('Request sent successfully.', {
            position: toast.POSITION.TOP_RIGHT,
            autoClose: 3000,
        });
    };

    console.log("requests", requests);
    const deleteMission = (id) => {
        dispatch(DeleteMission(id))
            .then(() => {
                setnotificationModal(false);
            })
            .catch(() => {
                setnotificationModal(false);
            });
    };





    const generatePDF = (rowData) => {
        setLoading(true);
        axios.get(`https://convoyage.onrender.com/api/users/getFactureByMissionId/${rowData._id}`)
            .then((response) => {
                const facture = response.data[0];
                const doc = new jsPDF();

                const logoBase64 = 'data:image/png;base64,';

                // Header: Logo and Title
                doc.addImage(logoBase64, 'PNG', 10, 10, 40, 20);
                doc.setFontSize(24);
                doc.setFont('Helvetica', 'bold');
                doc.text('Facture', 160, 25);

                // Company Information
                doc.setFontSize(10);
                doc.setFont('Helvetica', 'normal');
                doc.text('140 bis Rue DE RENNES', 10, 40);
                doc.text('PARIS 75006', 10, 45);
                doc.text('Tlphone : 06 51913143', 10, 50);
                doc.text('SIRET:98066356100028', 10, 55);

                // Facture Information
                doc.setFont('Helvetica', 'bold');
                doc.setFillColor(0, 102, 204); // Blue color for background
                doc.rect(10, 60, 90, 7, 'F');
                doc.rect(110, 60, 90, 7, 'F');
                doc.setTextColor(255, 255, 255);
                doc.text('FACTURER  ', 15, 65);
                doc.text('RF CLIENT', 115, 65);
                doc.setFontSize(10);
                doc.setTextColor(0, 0, 0);
                doc.text(`ID CLIENT: ${facture.partner}`, 115, 75);
                doc.text(`N de commande: ${facture.numFacture}`, 10, 75);

                // Conditions
                doc.rect(110, 85, 90, 7, 'F');
                doc.setFillColor(0, 102, 204);
                doc.text('CONDITIONS', 115, 90);
                doc.text('Paiement  la commande', 115, 100);

                // Table
                doc.autoTable({
                    startY: 105,
                    head: [['DESCRIPTION', 'QT', 'PRIX UNITAIRE', 'MONTANT']],
                    body: [
                        ['DISTINATION COMBIEN DE km', '46', '1,50', '69,00'],
                        ['PLEIN DE CARBURANT', '1', '10,00', '10,00'],
                        ['RECHARGE ELECTRIQUE', '0', '10,00', '-'],
                        ['PLAQUE W GARAGE', '1', '30,00', '30,00'],
                        ['LAVAGE EXTERIEUR', '1', '15,00', '15,00'],
                        ['LAVAGE INTERIEUR', '1', '18,00', '18,00'],
                        // Add more items here based on your facture data
                    ],
                    theme: 'grid',
                    headStyles: {
                        fillColor: [0, 102, 204],
                        textColor: [255, 255, 255],
                    },
                    styles: {
                        halign: 'center',
                    },
                    columnStyles: {
                        0: { halign: 'left' },
                    }
                });

                // Total
                doc.setFillColor(240, 248, 255); // Light blue color for the totals section
                doc.rect(140, doc.lastAutoTable.finalY + 10, 60, 7, 'F');
                doc.text('TOTAL HT', 145, doc.lastAutoTable.finalY + 15);
                doc.text(`${facture.totalAmmount}`, 195, doc.lastAutoTable.finalY + 15, { align: 'right' });
                doc.text('TOTAL TTC', 145, doc.lastAutoTable.finalY + 25);
                doc.text(`${facture.totalAmmount}`, 195, doc.lastAutoTable.finalY + 25, { align: 'right' });

                // Footer
                doc.setFontSize(10);
                doc.text('*Mode de rglement : Virement bancaire (FR76 2823 3000 0168 3398 1016 122)', 10, doc.lastAutoTable.finalY + 40);
                doc.text('Pour toute question, veuillez contacter', 10, doc.lastAutoTable.finalY + 50);
                doc.text('GAIES Rachid, 06 51 91 31 43, CARVOY7@GMAIL.COM', 10, doc.lastAutoTable.finalY + 55);

                doc.save(`Facture_${rowData._id}.pdf`);
                setLoading(false);
            })
            .catch((error) => {
                console.error("There was an error fetching the facture data!", error);
                setLoading(false);
            });
    };

    const getSeverity = (status) => {
      switch (status) {
          case 'in progress':
              return 'warning';

          case 'Accepted':
              return 'success';

          case 'Completed':
              return 'info';

          case 'rejected':
              return 'danger';


      }
    };

    const statusItemTemplate = (option) => {
      return <Tag value={option} severity={getSeverity(option)} />;
    };
    const [statuses] = useState(['in progress', 'Accepted', 'Completed', 'rejected']);

    const statusBodyTemplate = (rowData) => {
      return <Tag value={rowData?.status} severity={getSeverity(rowData?.status)} />;
    };

    const statusRowFilterTemplate = (options) => {
      return (
          <Dropdown value={options.value} options={statuses}
          // onChange={(e) => {

          //   options.filterApplyCallback(e.value);
          // }}
          itemTemplate={statusItemTemplate} placeholder="Select One" className="p-column-filter" showClear style={{ minWidth: '12rem' }} />
      );
    };



    const onGlobalFilterChange = (e) => {
        const value = e.target.value;
        let _filters = { ...filters };
        _filters['global'].value = value;
        setFilters(_filters);
        setGlobalFilterValue(value);
    };

    const actionBodyTemplate = (rowData) => {
      const createdAt = moment(rowData?.createdAt); // Convert createdAt to a moment object
      const now = moment(); // Get the current time

      // Calculate 48 hours after the mission creation time
      const showEditButtonStart = moment(createdAt).add(1, 'hours'); // 48 hours after creation

      // Calculate 24 hours before mission end (e.g., you might have a mission end time)
      const showEditButtonEnd = moment(createdAt).add(72, 'hours'); // 24 hours after 48-hour period ends

      // Check if the current time is within the allowed edit window
      const canEdit = now.isBetween(showEditButtonStart, showEditButtonEnd);

console.log("canEdit",  rowData.status);
        return (
            <React.Fragment>
                {canEdit  && (
                <Link to={`/partner/edit-mission/${rowData?._id}`}>
                    <Btn icon="pi pi-pencil" disabled={rowData.status=="Termine"} rounded outlined className="mr-2" />
                </Link>
            )}
                <Btn icon="pi pi-trash" rounded outlined severity="danger" onClick={() => {
                    setnotificationModal(true);
                    setselectedItem(rowData?._id);
                }}
                disabled={rowData.status=="Termine"}

                />
                {/* <Btn
                    icon="pi pi-download"
                    onClick={() => generatePDF(rowData)}
                    label={loading ? 'Generating...' : 'Download PDF'}
                    disabled={loading}
                /> */}
                <Btn  type="button" disabled={loading} icon={ loading? <i className="pi pi-spin pi-spinner" /> : "pi pi-file-pdf"} severity="warning" rounded onClick={() => generatePDF(rowData)} data-pr-tooltip="PDF" />
            </React.Fragment>
        );
    };

    const header = (
        <Row>
            <Col>
                <span className="p-input-icon-left">
                    <i className="pi pi-search" />
                    <InputText value={globalFilterValue} onChange={onGlobalFilterChange} placeholder="Keyword Search" />
                </span>
            </Col>
        </Row>
    );

    return (
        <>
            <UserHeader />
            <Container className="mt--7" fluid>
                <Row>
                    <div className="col">
                        <Card className="shadow">
                            <CardHeader className="border-0">
                                <h3 className="mb-0">Liste de toutes les missions</h3>
                            </CardHeader>
                            <div className="card">
                                <DataTable
                                    paginator
                                    rows={5}
                                    rowsPerPageOptions={[5, 10, 25]}
                                    value={requests}
                                    header={header}
                                    filters={filters}
                                    size={"small"}
                                    filterDisplay="row"
                                    globalFilterFields={['_id', 'name', 'status']}
                                    sortMode="multiple"
                                    className="thead-light"
                                    emptyMessage="No Missions found."
                                    onRowClick={(e) => {const url = `/partner/request-details/${e.data._id}`; history.push(url); }}
                                >
                                    <Column field="address.display_name" header="Point de dpart" sortable />
                                    <Column field="destination.display_name" header="Destination" sortable />
                                    <Column field="distance" body={(rowData) => `~${Math.floor(rowData.distance)}km`} header="Distance (km)" sortable />
                                    <Column field="createdAt" body={(rowData) => new Intl.DateTimeFormat('en-US', { day: '2-digit', month: '2-digit', year: '2-digit' }).format(new Date(rowData.createdAt))} header="Cr le" sortable />
                                    <Column field="status" header="Statut" showFilterMenu={false} filterMenuStyle={{ width: '14rem' }} style={{ minWidth: '12rem' }} body={statusBodyTemplate} filter
                                    filterElement={statusRowFilterTemplate}

                                    />
                                    <Column body={actionBodyTemplate} header="Actions" exportable={false} />
                                </DataTable>
                            </div>
                            <CardFooter className="py-4">
                                <nav aria-label="...">
                                    {/* Pagination logic here */}
                                </nav>
                            </CardFooter>
                        </Card>
                    </div>
                </Row>
            </Container>

            {/* Modal for delete confirmation */}
            <Modal
                className="modal-dialog-centered modal-danger"
                contentClassName="bg-gradient-danger"
                isOpen={notificationModal}
            >
                <div className="modal-header">
                    <h6 className="modal-title" id="modal-title-notification">
                    Votre attention est requise
                    </h6>
                    <button
                        aria-label="Close"
                        className="close"
                        type="button"
                        onClick={() => setnotificationModal(false)}
                    >
                        <span aria-hidden={true}></span>
                    </button>
                </div>
                <div className="modal-body">
                    <div className="py-3 text-center">
                        <i className="ni ni-bell-55 ni-3x" />
                        <h4 className="heading mt-4">Vous devriez lire ceci!</h4>
                        <p>
                        Lorsque vous cliquez sur 'Ok, compris', la demande sera supprime{selectedItem}
                        </p>
                    </div>
                </div>
                <div className="modal-footer">
                    <Button className="btn-white" color="default" type="button" onClick={() => deleteMission(selectedItem)}>
                        {isLoad ? (
                            <div className="spinner-border text-light" role="status">
                                <span className="visually-hidden"></span>
                            </div>
                        ) : (
                            "Ok, compris"
                        )}
                    </Button>
                    <Button className="text-white ml-auto" color="link" type="button" onClick={() => setnotificationModal(false)}>
                    Fermer
                    </Button>
                </div>
            </Modal>
        </>
    );
}

export default ListOfMissions;
